import Link from "next/link";

const Section2Home = () => {
  return (
    <section>
      <div className="container">
        <div className="section-head-two">
          <div className="element-section2">
            <Link href="/emaillist">
              <p></p>
            </Link>
            <h1>اشترك في أفضل نشرات الغذائية</h1>
            <p>
              للحصول على حياه صحية وبعيده عن الامراض ارسل الايميل الخاص بك
              لارشادك باخر الاخبار والانظمة الصحية
            </p>
          </div>
          <div>
            <input type="submit" value="Add my email to the list" />
          </div>
        </div>
      </div>
    </section>
  );
};
export default Section2Home;
